import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Animated, Dimensions } from "react-native-web";
import { StyleSheet } from "react-native";

const { width, height } = Dimensions.get("window");

function Shape() {
  return (
    <MotiView
      from={{
        opacity: 0,
        scale: 0.5,
      }}
      animate={{
        opacity: 1,
        scale: 1,
      }}
      transition={{
        type: "timing",
      }}
      style={styles.shape}
    />
  );
}

const App = () => {
  const menuPositionY = us(new Animated.Value());

  const AnimatedBoxStyle = useAnimatedStyle(() => {
    return {
      position: "absolute",
      backgroundColor: "black",
      height,
      zIndex: 50,
      width,
      transform: [
        {
          translateY: menuPositionY.value,
        },
      ],
    };
  });
  return <Animated.View style={AnimatedBoxStyle} />;
};

const styles = StyleSheet.create({
  shape: {
    justifyContent: "center",
    height: 250,
    width: 250,
    borderRadius: 25,
    marginRight: 10,
    backgroundColor: "white",
  },
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "row",
    backgroundColor: "#9c1aff",
  },
});

export default App;
